import React from 'react';
import { Typography, Paper } from '@mui/material';
import StorefrontOutlinedIcon from '@mui/icons-material/StorefrontOutlined';

const styles = {
    container: {
      padding: '2rem',
      display: 'flex',
      justifyContent: 'center',
    },
    mainPaper: {
      position: 'relative', // Add relative positioning to the main Paper
      width: '50%',
      height: 'auto',
      backgroundColor: '#325636',
      padding: '2rem', // Add padding to the main Paper
      display: 'flex',
      justifyContent: 'center'
    },
    text: {
        fontWeight: 'bold',
        color: '#FFFFFF',
        textAlign: 'left'
    },
    icon: {
        color: '#FFFFFF',
        marginLeft: '1rem'
    }
  };

const PickupPage = () => {
  return (
    <div style={styles.container}>
      <Paper elevation={3} sx={styles.mainPaper}>
        <Typography variant='h6' style={styles.text}>Store details</Typography>
        <StorefrontOutlinedIcon style={styles.icon} />
      </Paper>
    </div>
  );
};

export default PickupPage;
